diaglit (Dialog builder based on twitter-bootstrap)
===================================================

[Examples](http://carlo-colombo.github.com/diaglit)

Feature
-------
* Multiple tab
* Built in controls
  * input of type hidden, text, time, date, datetime, password, email, range, number
  * textarea
  * select
  * ...
* Pluggable custom controls
* Dialog initializazion

Dependencies
------------
* [qwery](https://github.com/ded/qwery)
* [bean](https://github.com/fat/bean)
* [ender-twitter-bootstrap](http://rvagg.github.com/bootstrap/javascript.html)
* [underscorejs](http://documentcloud.github.com/underscore)

Ender Build
-----------
`#~ ender build diaglit`

Use
------------
* include `<link rel="stylesheet" href="http://twitter.github.com/bootstrap/1.4.0/bootstrap.min.css">` in your html
* ```
	var diaglit =require('diaglit'), //require diaglit
		dialog = diaglit({...});

	dialog.$dialog.modal('show')
```
* Example object description
* ```
	{
		"tabs":{
			"tab1" : {
				"label" : "Tab 1",
				"fields":[
					{
						"name": "title",
						"type": "text",
						"placeholder": "Insert name here",
						"label": "Character name"
					},
					{
						"name": "characterClass",
						"type": "text",
						"label": "class"
					},
					{
						"name": "level",
						"type": "number",
						"max": 30,
						"min":1,
						"value": 1
					}			]
			}
		},
		"title": "Properties"
	}
``` 
* Configurable submit function 
* ```
	dialog = diaglit({...}, {
		onSubmit : function(){...}
	});
``` 
shortcut: `dialog = diaglit({...}, function(){})`
* Data initialization 
* ```
	dialog = diaglit({...}, {
		data: {
			field_name1: 'value1',
			field_name2: 12
		}		
	});
```
* Custom controls
* ```
	var controls = require('diaglit.controls');
		controls['custom'] = function(field,data){
			... return some DOM
		}

	var	dialog = require('diaglit')({
		....
		"fields" : [
			{
				type : "custom",
				name : "custom name"
			}
		]
	})
```

#DirList


### A simple & old school directory listing module for node. Inspired by Apache's mod_autoindex.

## Installation

	npm install dirlist

## Usage

Use dirlist in your `connect` or `express` application by passing it the root folder you would like it to auto index.

	var connect = require('connect'),
		dirlist = require('dirlist');

	//Base folder that will be searchable from the url.
	var base = '/Users/lemendo/Music/';

	var host = "localhost";
	var port = 1337;

	connect(
			connect.favicon(),
			dirlist(base),
			connect.static(base)
		).listen(port, host);

	console.log('Server running at http://'+host+':'+port+'/');

To enable file download, you must also set a `static` middleware with the same path as the dirlist middleware.

# Doctoralia Node.js wrapper

This is a simple wrapper for the Doctoralia API.

[Doctoralia.com](http://doctoralia.com) is the global platform for Doctors' appointments. Their API let you search for doctors and medical centers in 11 different countries in the world.

## Installing

`npm install doctoralia

## Developer Portal

On the portal you will find API keys and documention.[https://developer.doctoralia.com/](https://developer.doctoralia.com/)

The official Doctoralia API documentation can be found at [https://developer.doctoralia.com/docs](https://developer.doctoralia.com/docs).

## Usage

```js
var Doctoralia = require('doctoralia');

var doc = new Doctoralia('YOUR_API_KEY');

// Get the countries where Doctoralia is available
doc.getCountries(function(err,result){
    console.log(result);
});

// Get all the medical specialities available in France 
doc.getSpecialitiesByCountryId('fr',function(err,result){
	console.log(result);
});

// Returns a list of professionals in France 
// specialityId: 1136 is cancerolgy
// provinceId: 10069 is Charente Maritime
doc.getProfessionals('fr',{
            specialityId: 1136,
            provinceId: 10069
        },function(err,result){
	console.log(result);
});
```
